import Slider from '../components/Slider';
export default {
  metaInfo: {
    title: "Home"
  },
  components: {
    Slider: Slider
  },
  computed: {
    //featuredProducts () { return this.$page.allShopifyProduct.edges }
    featuredProducts: function featuredProducts() {
      return this.$page.allShopifyProduct.edges.filter(function (prod) {
        return prod.node.availableForSale === true;
      });
    }
  },
  methods: {
    selectProduct: function selectProduct(product) {
      this.$router.push({
        path: "/product/" + product.node.handle
      });
    }
  }
};
